_nc_cat=110\u0026_nc_ohc=lrUvkAa2pbsAX-YH0S_\u0026oh=b4ade498f54b33d1066698511a4d59b0\u0026oe=5EA31D7F","config_width":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/90055244_204835234085062_9039787519310844133_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=lrUvkAa2pbsAX-YH0S_\u0026oh=54c722225fbd80da52a7324463772b3e\u0026oe=5EA76C1E","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"\u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a\u996e\u54c1"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2265717141556896769","edge_media_to_caption":{"edges":[{"node":{"text":"Friends... we are all in uncharted waters right now\u2014 there\u2019s a crushing amount of uncertainty, fear, noise and chaos.\u2063\u2063\n\u2063\u2063\nWe\u2019ve all been hearing about \u2018Social Distancing\u2019, i.e. isolating, avoiding gathering in public places, staying home\u2014all to stop or slow down the spread of COVID-19.\u2063\u2063\n\u2063\nAnd it\u2019s scary.\u2063\n\u2063\u2063\nBut it\u2019s important to understand what IS in your Span of Control: you can be part of the solution! \u2063\u2063\n\u2063\u2063\nThree things:\u2063\u2063\n\ud83c\udf1fFocus right now on being a great teammate. A teammate on Team Social Solidarity\ud83d\ude4c\ud83c\udffb. Just like that starfish you whip back into the ocean giving it a second lease on life, YOU choosing to stay home can make a difference to one person. How awesome is THAT?\u2063\u2063\n\ud83c\udf1fFlight Plan For Success\u2014plot out your tomorrow. You don\u2019t have to figure out a 3 yr plan, who the heck knows what things will look like in 3 years. But take a breath, and write a plan down for tomorrow. You can plan part of your day anyway, and that will give you a bit of a sense of control\ud83e\udd19\ud83c\udffb!\u2063\u2063\n\ud83c\udf1fCommunicate. Continually. This is a fast-moving and dynamic situation. Holing up and shutting down will drain your energy faster than the speed of light... if you\u2019re a leader, TALK TO YOUR TEAM! they need to hear from you, even if your answer is \u2018I don\u2019t know \ud83e\udd37\ud83c\udffd\u200d\u2642\ufe0f\ud83e\udd37\ud83c\udffb\u200d\u2640\ufe0f...\u2019 . Call a friend, text a family member, heck ask me a question here, and I\u2019ll post a video for you! But don\u2019t go dark. Don\u2019t go silent. \u2063\u2063\n\u2063\u2063\nWe\u2019re all in this together, and it\u2019s going to be a rollercoaster. How will you know if you\u2019ve made a difference? In some cases you will never know, and rarely will the result be instantaneous.\u2063\u2063\n\u2063\u2063\nBut this I can be sure of: if we stick together, and If  we each focus on our span of control? We\u2019ll get through this faster\u2014together.\u2063\u2063\n\u2063\u2063\nYou\u2019ve got this \ud83e\udd19\ud83c\udffb\ud83e\udd19\ud83c\udffb\ud83e\udd19\ud83c\udffb.\n.\n.\n. \u202a#SocialDistancing \u202c#SocialSolidarity #spanofcontrol\n\u202a#Teamwork #leadership #safety #COVID\u30fc19 \u202c\n#leadership #servantleadership #coaching #life #kids #hope #positivity #adversity  #purpose #focus #discipline #attitude #family #success  #motivation #inspiration #mindset #tenacity #courage  #befearless #careylohrenz #fearlessleadership"}}]},"shortcode":"B9xcbxoAyQB","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584314552,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/89719928_138152614259668_7714510236645759480_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=104\u0026_nc_ohc=W1kxcafiKrAAX-KQIYx\u0026oh=03f4829aa96b743ca506479e6fa28926\u0026oe=5EA54CA5","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"186119047"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89719928_13815261  is required. Serving is helping me to not be so depressed in this time. We need volunteers to man the distribution table and make runs from the outlying collection locations (@getfitfoodsclt )  this week. Please reach out to me if you can help. \ud83c\udf1f"}}]},"shortcode":"B9xcSOvpaIN","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584314474,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/89981107_148667203050594_2965588223986914050_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=OXAy4CJlyGAAX9uBBb7\u0026oh=18af86b11381026312d388d3ba1fcbfe\u0026oe=5EA6324F","edge_liked_by":{"count":1},"edge_media_preview_like":{"count":1},"owner":{"id":"48807714"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89981107_148667203050594_2965588223986914050_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=OXAy4CJlyGAAX9uBBb7\u0026oh=019acaa0c2276f1f38a4c922af9738c0\u0026oe=5EA1AEF8","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89981107_148667203050594_2965588223986914050_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=OXAy4CJlyGAAX9uBBb7\u0026oh=fa1bf9ba96e3d74db1d7ac688703a084\u0026oe=5EA09C5F","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89981107_148667203050594_2965588223986914050_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=OXAy4CJlyGAAX9uBBb7\u0026oh=c395326aa6fe41a88dcad12099b57f07\u0026oe=5EA1AE15","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/89981107_148667203050594_2965588223986914050_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=106\u0026_nc_ohc=OXAy4CJlyGAAX9uBBb7\u0026oh=88d6d71c27b6b935c246fb825fed1714\u0026oe=5E9F79AF",
